import React from 'react';
import Head from 'next/head';

interface Props {
  styleTags?: string[];
}

const Layout: React.FunctionComponent<Props> = ({ children, styleTags }) => (
  <>
    <Head>
      {styleTags && styleTags.map((styleTag) => styleTag)}
    </Head>
    {children}
  </>
);

export default Layout;
